import "./Aside_Friends.scss"
import logo from "./ava-steam-92.jpg"

const AsideFriends=()=>{
    return(
        <div className="Aside_Friends">
            <h1>Друзья</h1>
            <img src={logo} alt="" />
            <button></button>
        </div>
    )
}

export default AsideFriends
